require 'rails_helper'
require 'faker'
 require 'tempfile'
RSpec.describe Api::V1::Requests::RequestsController, type: :request do

    before do 
      @organization = FactoryBot.create(:organization)
      @user = FactoryBot.create(:user, role: 'super_admin', organization_id: @organization.id)
      @token = JsonWebToken.encode(user_id: @user.id)
      @request = FactoryBot.create(:request, user_id: @user.id)
    end

    describe "POST /api/v1/requests/requests" do
      context 'with valid parameters' do
        let(:valid_request_params) do
          {
            request: {
              title: 'Sample Title',
              description: 'Sample Description',
              "ticket_images": 
             [{
              "images": [{"data": "data:image/png;base64,"}]},
              {
              "images": [{"data": "data:image/png;base64,"}]}]
                }
              }
        end

        it "creates a request and returns success" do
          post "/api/v1/requests/requests", headers: { token: @token }, params: valid_request_params
          expect(response).to have_http_status(:ok)
        end

        let(:valid_request_params1) do
          {
            request: {
              title: nil,
              description: nil,
              "ticket_images": 
             [{
              "images": [{"data": "data:image/png;base64,"}]},
              {
              "images": [{"data": "data:image/png;base64,"}]}]
                }
              }
        end

        it "creates a request and returns success" do
          post "/api/v1/requests/requests", headers: { token: @token }, params: valid_request_params1
          json_data = JSON.parse(response.body)
          expect(json_data["response_code"]).to eq 400
        end
      end
    end

    describe "PUT /api/v1/requests/requests/:id" do
      context 'with valid parameters' do
        let(:valid_request_params) do
          {
            data: {
             status: @request.status
            }
          }
        end

        it "creates a request and returns success" do
          put "/api/v1/requests/requests/#{@request.id}", headers: { token: @token }, params: valid_request_params
          expect(response).to have_http_status(:ok)
        end

        let(:valid_request_params1) do
          {
            data: {
             status: "escalate"
            }
          }
        end

        it "creates a request and returns success" do
          @user2 = FactoryBot.create(:user, role: 'super_admin', organization_id: @organization.id)
          @token2 = JsonWebToken.encode(user_id: @user2.id)
          @request2 = FactoryBot.create(:request, user_id: @user2.id)
          put "/api/v1/requests/requests/#{@request.id}", headers: { token: @token2 }, params: valid_request_params1
          json_data = JSON.parse(response.body)
          expect(json_data["message"]).to eq "You are not allowed to update the request with the specified status"
        end

        let(:valid_request_params2) do
          {
            data: {
             status: "reopened"
            }
          }
        end

        it "creates a request and returns success" do
          @user2 = FactoryBot.create(:user, role: 'manager', organization_id: @organization.id)
          @token2 = JsonWebToken.encode(user_id: @user2.id)
          @request2 = FactoryBot.create(:request, user_id: @user2.id)
          put "/api/v1/requests/requests/#{@request.id}", headers: { token: @token2 }, params: valid_request_params2
          json_data = JSON.parse(response.body)
          expect(json_data["errors"]).to eq "An unexpected error occurred: Invalid user role"
        end

         let(:valid_request_params3) do
          {
            data: {
             status: "reopened"
            }
          }
        end

        it "creates a request and returns success" do
          @user3 = FactoryBot.create(:user, role: 'employee', organization_id: @organization.id)
          @token3 = JsonWebToken.encode(user_id: @user3.id)
          @request3 = FactoryBot.create(:request, user_id: @user3.id)
          put "/api/v1/requests/requests/#{@request3.id}", headers: { token: @token3 }, params: valid_request_params3
          json_data = JSON.parse(response.body)
          expect(response).to have_http_status(:ok)
        end

        let(:valid_request_params4) do
          {
            data: {
             status: "in_progress"
            }
          }
        end

        it "creates a request and returns success" do
          @user4 = FactoryBot.create(:user, role: 'employee', organization_id: @organization.id)
          @token4 = JsonWebToken.encode(user_id: @user4.id)
          @request4 = FactoryBot.create(:request, user_id: @user4.id)
          put "/api/v1/requests/requests/#{@request4.id}", headers: { token: @token4 }, params: valid_request_params4
          json_data = JSON.parse(response.body)
          expect(response).to have_http_status(:ok)
        end
      end
    end

    describe "GET /api/v1/requests/requests" do
      context 'with valid parameters' do
        it "creates a request and returns success" do
          get "/api/v1/requests/requests", headers: { token: @token }
          expect(response).to have_http_status(:ok)
        end
      end

      context 'with valid parameters else condition' do
        it "creates a request and returns success" do
        @organization1 = FactoryBot.create(:organization)
        @user1 = FactoryBot.create(:user, role: 'employee', organization_id: @organization1.id)
        @token1 = JsonWebToken.encode(user_id: @user1.id)
          get "/api/v1/requests/requests", headers: { token: @token1 }
          expect(response).to have_http_status(:ok )
        end
      end
    end

    describe "GET /api/v1/requests/requests/:id" do
      context 'with valid parameters' do
        it "creates a request and returns success" do
          get "/api/v1/requests/requests/#{@request.id}", headers: { token: @token }
          expect(response).to have_http_status(:ok)
        end
      end
    end


    describe "POST /api/v1/requests/dashboard" do
      context 'with valid parameters' do
        it "creates a request and returns success" do
          post "/api/v1/requests/dashboard", headers: { token: @token }
          expect(response).to have_http_status(:ok)
        end

        it "creates a request and returns success" do
          @user1 = FactoryBot.create(:user, role: 'employee', organization_id: @organization.id)
          @token1 = JsonWebToken.encode(user_id: @user1.id)
          @request1 = FactoryBot.create(:request, user_id: @user.id)
          post "/api/v1/requests/dashboard", headers: { token: @token1 }
          expect(response).to have_http_status(:ok)
        end
      end
    end
end
